import logo from "../../images/logo.png";
import { Wrapper } from "./styled";

export const Top = () => {
  return (
    <Wrapper>
      <img src={logo} />
      <h1>
        <strong>Felgi, CNC, Malowanie proszkowe</strong>
      </h1>
    </Wrapper>
  );
};
